Alyssa Branch, Allie Jordan, Giselle Leon, Elaina Raye, Gia Steel

Three Cheers For Giselle! Elaina Is Daddy's Girl!
Gia's Two Hand Touch! Allie Studies Hard! Alyssa Loves Dick!
Alyssa is on a mission to get an autograph from her favourite musician. But he gives her something much bigger to remember him by. Allie has got to cram if she's gonna get a passing grade, but she'd sooner cram the janitor's broom stick up inside her. Elaina's father tries to set her up with a nice young man, but what she really needs is a big bad boy.. It's audition time for young Gia, and to get the part of her dreams, she's gonna need to handle the big Gunn. Giselle is dating the quarterback of the football team, but she soon learns that running backs are the real star players.
